import React, { Component } from 'react'
import { Form, Button } from 'react-bootstrap'
class Login extends Component {
    constructor(props)
    {
        super(props);
        this.onSubmit = this.onSubmit.bind(this);
    }
    onSubmit(event)
    {
        this.preventDefault();
        console.log(event.target);
    }
    render() {
        return <div className='container-fluid' style={{backgroundColor:'#f9f9f9'}}>
            <div className='row' style={{padding: '2%'}}>
                    <div style={{ margin: 'auto',fontSize: '30px',fontWeight:'400' }}>Sign in</div>
            </div>
            <Form onSubmit={this.onSubmit} className='col-lg-4' style={{ margin: 'auto',padding: '5%',backgroundColor:'white',borderRadius: '2%' ,border:'1px solid #e8e5e5' }}>
                <Form.Group controlId="formBasicEmail" style={{padding:'1%'}}>
                    <Form.Label>Email address</Form.Label>
                    <Form.Control type="email" placeholder="Enter email" />
                    {/* <Form.Text className="text-muted">
                        We'll never share your email with anyone else.
                        </Form.Text> */}
                </Form.Group>

                <Form.Group controlId="formBasicPassword" style={{padding:'1%'}}>
                    <Form.Label>Password</Form.Label>
                    <Form.Control type="password" placeholder="Password" />
                </Form.Group>

                {/* <Form.Group controlId="formBasicCheckbox">
                        <Form.Check type="checkbox" label="Check me out" />
                    </Form.Group> */}
                <div className='row' style={{padding:'1%'}}>
                    <Button variant="primary" type="submit" style={{ margin: 'auto' }}>
                        Submit
                        </Button>
                </div>
            </Form>
        </div>
    }
}
export default Login;
